		<div class="programs wrapper">
			<h1>Our Community Programs</h1>
			<p>
				Partnering with social organizations helps us drive impact for other
				communities, sustains our core team, and creates profits that enable us
				drive our social impact programs.
			</p>
			<ul class="prog-grid">
				<li class="program">
					<img src="/collect.png" alt="" />
					<h2 class="cta-btn">
						<a
							target="_blank"
							href="https://mailchi.mp/3627159ec8c7/senpaicollective"
						>
							Senpai Collective
						</a>
					</h2>
					<p>
						The collective is a home for our community of creative talents who
						believe in using their creativity to create a better future for
						humanity, it is an extension of the Senpai brand.
					</p>
				</li>
				<li class="program">
					<img src="/design101.png" alt="" />
					<h2 class="cta-btn">
						<a
							target="_blank"
							href="https://mailchi.mp/3627159ec8c7/senpaicollective"
						>
							Design 101
						</a>
					</h2>
					<p>
						Design 101 is an online remote design training program, running on a free and paid model and has impacted over 600 youths with a fundamental understanding of design. 
					</p>
				</li>
				<li class="program">
					<img src="/talents.png" alt="" />
					<h2 class="cta-btn">
						<a
							target="_blank"
							href="https://mailchi.mp/3627159ec8c7/senpaicollective"
						>
							Senpai Talents
						</a>
					</h2>
					<p>
					The Senpai talents are specially trained members of the collective who get to work with our partner organizations/clients on contract based opportunities and on in-house ideas with the core team.
					</p>
				</li>
			</ul>
		</div>
