<script>
import Vue from 'vue'
import VueTypedJs from 'vue-typed-js'
import axios from 'axios'

import MainNav from '~/components/MainNav-Bar.vue'
import Logo from '~/components/Logo.vue'
import Landing from '~/components/Landing-Page.vue'
import ArticlePreview from '~/components/Article-preview.vue'
import Contact from '~/components/Contact-form.vue'
import Footer from '~/components/Footer.vue'
import client from '~/plugins/contentful'

Vue.use(VueTypedJs)

// const client = createClient()

export default {
	components: {
		MainNav,
		Logo,
		Landing,
		ArticlePreview,
		Footer,
		Contact,
	},
	data() {
		return {
			scrolled: false,
			showlogo: false,
			showMobileMenu: false,
		}
	},
	async asyncData({ env }) {
		// fetch the owner of the blog
		// client.getEntries({
		// 	'sys.id': env.CTF_PERSON_ID,
		// }),
		// fetch all blog posts sorted by creation date
		const post = await client.getEntries({
			content_type: 'caseStudy',
			'fields.tag[in]': 'featured',
		})

		// return {
		// 	// person: entries.items[0],
		// 	featured: post.items,
		// }

		const ip = await axios.get(
			'https://api.instagram.com/v1/users/self/media/recent?access_token=2105340134.1677ed0.52d17f9dd46a42d3851e48e4688f31e6&count=10',
		)

		return { featured: post.items, instagram: ip.data }
	},
	created() {
		if (process.browser) {
			// eslint-disable-next-line nuxt/no-globals-in-created
			window.addEventListener('scroll', this.handleScroll)
		}
	},
	destroyed() {
		if (process.browser) {
			window.removeEventListener('scroll', this.handleScroll)
		}
	},
	methods: {
		showtooltip(e) {
			// e.target.previousElementSibling.style.display = 'block'
			console.log(e)
		},
		hidetooltip() {},
		handleScroll(e) {
			// console.log(window.scrollY)
			// console.log(e)
			if (window.scrollY > 200) {
				this.showMobileMenu = true
				this.showlogo = true
			} else if (window.scrollY < 200) {
				this.showlogo = false
				this.showMobileMenu = false
			}
			// this.scrolled = window.scrollY > 0
		},
	},
}
</script>

